import React from 'react';
// import {Card} from 'react-bootstrap/Card';
import {Card} from 'react-bootstrap/Card'


function card() {
    return (
        <div>
            <Card>
                <Card.Title>Pokedex</Card.Title>
                <Card.Body>
                    A Pokemon matching game utilizing React Hooks, and state management.
                </Card.Body>
            </Card>

        </div>
    )
}

export default card
